Review:
다른옷이 왔어요 뒤늦게 택배를 뜯었는데 청바지 하나오고 주문 내역에 올린 상품은 하나도 안왔네요;; 
배송 포장할때 재 확인 안하나요?
확인후 연락바랍니다 \

