저 치마에 저렇게 입었는데 저 삘이 안남;;;;
이상하네;;; ㅠㅜㅠㅜㅠㅜㅠㅜㅠㅜㅠㅜㅠㅜ

그냥 그래요... 사실 디자인은 참 예쁜데...
모자도 너무 축 쳐져있어서 모양이 안예쁘고...
무엇보다 안감이 너무 잘 튿어져요;
너무 약한건지;
벌써 너덜너덜;;;;

보통입니다 조금 실망했어요 ㅠ 소재도 얇고...
일단 제가 허리가 긴편이긴한데 이 옷은 짧네요...
 모델 언니보다 살이 더 있어서 그런걸수도 있지만요 ^^ ;;;

나쁘지 않습니다.ㅇㅇ 일단 바지 길이랑 다리 폭은 맞는데...허리가 많이 남더라구요
그리고 허리부터 가랑이 사이가 약간 좁아서 좀 불편한 느낌도 있고
 저는 허벅지 통은 맞는데, 허리가 많이 남습니다.;;;

사이즈가 많이 커요 m사이즈 샀어요~ 바지가 무지 크네요;
s 사이즈로 바꿔야 되나;; 흘러내리겠어요 정말;;그렇다고 내가 살이빠진것도 아닌데..
암튼 사이즈가 큽니다.

음... 워낙 후기가 좋아서 구매했는데요 173에 60인데 여자사이즈 입으니까 딱맞아요.
근데 오른쪽호주머니가 안꼬매져있더라고요...ㅋㅋㅋ 교환할려다가 교환하려면 배송비든데서 걍안했어요;; 그리고 오른쪽 소매도 박음질처리가 잘안되서 그냥입으면 이상하게됨
옷은이쁜데 하자있는게 있네여;;

옷이 자구 말려요 밑단이 저렇게 생긴걸 간과하구 구입했더니 이모냥;;
첨에 이럴줄 모르고 반품 안했는데
그냥 옷걸이에 계속 걸려만 있어요

봄에 딱 이쁜 컬러 봄에 딱 이쁜 컬러네요.
근데 옆트임은 제가잘 안입어봐서... 살짝 걱정 이네요.
계속찢어 지지 않을까 하는..;;;

디자인이 멋쪄요 생각했던것보다 사이즈는 큰것같아요
혹시 주문하실꺼면 한치수 평소보다 작은사이즈를 추천드립니다.
이옷이 대세긴한듯 술집가면 같은옷 한명씩 마주치기도..^^;;

상품이 왜이럼? 상품이 무슨 반품상품을 보내준건지 목이 다 늘어져있음
옷도 쭈글쭈글하고 뭔가 허옇고 ;.;; 누가 반품한걸 배송해준것 같아서 기분 안좋음
